import React, { useState } from 'react';
import TimePicker from 'react-time-picker';

const TimeSelector = () => {

    const [value, onChange] = useState('10:00');

    return (
        <div>

        <TimePicker
            onChange={onChange}
            //style={{ color: 'grey', fontSize: '30px'}}
            value={value}
        />

        </div>
    )
}

export default TimeSelector;
